import React from "react";

const PokemonMovesCard = ({
  pokemonData,
  currentSelectedPokemon,
  formatText,
}) => {
  console.log(
    "adsfasfsafdasfaF",
    pokemonData[currentSelectedPokemon].moves[67].version_group_details[0]
      .level_learned_at
  );

  console.log(
    pokemonData[currentSelectedPokemon].moves[67].version_group_details[0]
      .move_learn_method.name
  );

  return (
    <table className="table-auto">
      <thead>
        <tr>
          <th className="px-4 py-2">Move Name</th>
          <th className="px-4 py-2">Level Learned At</th>
          <th className="px-4 py-2">Learn Method</th>
        </tr>
      </thead>
      <tbody>
        {pokemonData[currentSelectedPokemon].moves.map((move) => (
          <tr key={move.move.name}>
            <td className="border px-4 py-2 font-bold">
              {formatText(move.move.name)}
            </td>
            <td className="border px-4 py-2">
              Level Learned At: {move.version_group_details[0].level_learned_at}
            </td>
            <td className="border px-4 py-2">
              Learn Method:
              {move.version_group_details[0].move_learn_method.name ===
              "machine"
                ? "TM"
                : formatText(
                    move.version_group_details[0].move_learn_method.name
                  )}
            </td>
          </tr>
        ))}
      </tbody>
    </table>
  );
};

export default PokemonMovesCard;
